      <TextField onChange={(e)=> setJobTitle(e.target.value)} id="outlined-basic" label="Job Title" variant="outlined" />
      <Button type='submit' variant="contained" onClick={createContact}>Create Contact</Button>
    </form>
        </>
    )
}


